import React from "react";
import { Card, CardBody, CardHeader, Form, FormGroup } from "reactstrap";

const SideNav = () => {
	return (
		<div>
			<Card>
				<CardHeader>映画監督</CardHeader>
				<CardBody>
					<Form>
						<FormGroup>
							<input type="text" className="form-control" name="director" />
						</FormGroup>
					</Form>
				</CardBody>
			</Card>
		</div>
	);
};

export default SideNav;
